@attr 1=12 @attr 4=107 @attr 2=5 41500 - означает  искать книги с id больше 41500

@attr 1=9032 @attr 2=6 "Худ фонд"  -  означает что книга не должна быть из худфонда

@attr 1=7 @attr 2=6 "x" - означает что ISBN не должен быть равен x, таким образом я отсеиваю все книги у которых не указан ISBN

@attr 1=31 @attr 2=5 2002 - означает показывать книжки, год издания которых больше 2004
